import React, {useState} from "react";



export type ValueType = 1 | 2 | 3 | 4 | 5

type RatingType = ()=> {
    value: ValueType;
}

export function Rating(props:RatingType) {

    const Started = (setStars: number) => {
        setValue(setStars)
    }

    let [value, setValue] = useState(0)

    return (

        <div><Star selected={value > 0} started={Started} value={props.value}/>
            <Star selected={value > 1} started={Started} value={props.value}/>
            <Star selected={value > 2} started={Started} value={props.value}/>
            <Star selected={value > 3} started={Started} value={props.value}/>
            <Star selected={value > 4} started={Started} value={props.value}/>
        </div>)

}


type StarType = {
    selected: boolean;
    started: (value: ValueType) => void;
    value: ValueType;
}

export function Star(props: StarType) {

    return <span onClick={() => props.started(props.value)}>
        {props.selected ? <b>star</b> : 'star'}
          </span>


}
